import React from "react";
import mchammer from "../../img/mchammer.gif";
import selfIcon from "../../img/self_image.png";

const Icon = () => {
  return <img src={selfIcon} alt="icon of myself"></img>;
};

const McHammer = () => {
  return <img src={mchammer} alt="gif of mchammer"></img>;
};

const Main = () => {
  return (
    <div>
      <McHammer />
      <McHammer />
      <McHammer />
      <McHammer />
    </div>
  );
};

export default Main;
